import React from "react";

const cars = [
  {
    id: 1,
    name: "Ferrari F40",
    price: "$1,200,000",
    description: "Classic Italian supercar with a twin-turbo V8 engine.",
    image: "/images/ferrari-f40.jpg",
  },
  {
    id: 2,
    name: "Lamborghini Aventador",
    price: "$500,000",
    description: "Modern masterpiece with a V12 engine.",
    image: "/images/lamborghini-aventador.jpg",
  },
];

const CarsForSale = () => {
  return (
    <div className="cars-container">
      <h2>Cars for Sale</h2>
      <div className="cars-list">
        {cars.map((car) => (
          <div key={car.id} className="car-card">
            <img src={car.image} alt={car.name} />
            <h3>{car.name}</h3>
            <p>{car.description}</p>
            <p>
              <strong>Price: </strong>
              {car.price}
            </p>
            <button>View Details</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default CarsForSale;
